import React, { useState } from "react";
import Api from './FuncionarioApi'


const Funcionario = (props) => {

    let [funcionario, setFuncionario] = useState({nome: '', sobrenome: '', email:'' , numeroNIS: ''});

    let [nome, setNome] = useState('');
    let [sobrenome, setSobrenome] = useState('');
    let [email, setEmail] = useState('');
    let [numeroNIS, setNoumeroNIS] = useState(0);

    Api.loadFuncionario(props.id, (data) => {
        if (data) {
            setFuncionario(data);
        }
    })

    return (
        <div>
            <div className="form">
                <div>
                    <h1>Edição de Funcionário ({props.id})</h1>
                </div>

                <label>Nome</label>
                <input type='text' name='nome' value={funcionario.nome} onChange={setNome(e.target.value)}/>

                <label>Sobrenome</label>
                <input type='text' name='sobrenome' value={funcionario.sobrenome} onChange={setSobrenome(e.target.value)} />

                <label>E-mail</label>
                <input type='email' name='email' value={funcionario.email} onChange={setEmail(e.target.value)} />

                <label>Número NIS</label>
                <input type='number' name='numeroNIS' value={funcionario.numeroNIS} onChange={setNoumeroNIS(e.target.value)} />
                <br/><br/>
                <input type='button' value='Confirma' onClick={Api.salvaFuncionario} />
                <input type='button' value='Fechar' onClick={Api.fechaCadastro} />
            </div>
        </div>
    )
}
export default Funcionario;
